struct TimeSeriesExampleInternalData
{
	int m_canvasIndex;
	struct Common2dCanvasInterface* m_canvas;

	int m_width;
	int m_height;

	TimeSeriesExampleInternalData()
		:m_canvasIndex(-1),
		m_canvas(0),
		m_width(512),
		m_height(512)
	{
	}
};

TimeSeriesExample::TimeSeriesExample(struct CommonGraphicsApp* app)
{
	m_app = app;
	m_internalData = new TimeSeriesExampleInternalData;
}

TimeSeriesExample::~TimeSeriesExample()
{
	delete m_internalData;
}

void TimeSeriesExample::initPhysics()
{
	//request a visual bitma/texture we can render to
	
	

	m_internalData->m_canvas = m_app->m_2dCanvasInterface;
	

	if (m_internalData->m_canvas)
	{
		
		m_internalData->m_canvasIndex = m_internalData->m_canvas->createCanvas("Time Series",m_internalData->m_width,m_internalData->m_height);
		for (int i=0;i<m_internalData->m_width;i++)
		{
			for (int j=0;j<m_internalData->m_height;j++)
			{
				unsigned char red=255;
				unsigned char green=255;
				unsigned char blue=255;
				unsigned char alpha=255;
				m_internalData->m_canvas->setPixel(m_internalData->m_canvasIndex,i,j,red,green,blue,alpha);
			}
		}
		unsigned char red=0,green=0,blue=0,alpha=255;
		grapicalPrintf("  This is just a time series test", sFontData, 10,10,red,green,blue,alpha);
		
		grapicalPrintf("0", sFontData, 2,zero,red,green,blue,alpha);
		grapicalPrintf("1", sFontData, 2,zero-amp,red,green,blue,alpha);
		grapicalPrintf("-1", sFontData, 2,zero+amp,red,green,blue,alpha);
		
		m_internalData->m_canvas->refreshImageData(m_internalData->m_canvasIndex);

	}

}


void TimeSeriesExample::exitPhysics()
{
	
	if (m_internalData->m_canvas && m_internalData->m_canvasIndex>=0)
	{
		m_internalData->m_canvas->destroyCanvas(m_internalData->m_canvasIndex);
	}
}


void TimeSeriesExample::grapicalPrintf(char* str,	void* fontData, int rasterposx,int rasterposy, unsigned char red, unsigned char green, unsigned char blue, unsigned char alpha)
{
	unsigned char c;
	int x=0;
	int xx=0;
	
	while ((c = (unsigned char) *str++)) {
		
		x=xx;		
		unsigned char* fontPtr = (unsigned char*) fontData;
		char ch = c-32;
		
		int sx=ch%16;
		int sy=ch/16;
		
		
		for (int i=sx*16;i<(sx*16+16);i++)
		{
			int y=0;
			for (int j=sy*16;j<(sy*16+16);j++)
			{
				unsigned char packedColor = (fontPtr[i*3+255*256*3-(256*j)*3]);
				//float colorf = packedColor ? 0.f : 1.f;
				float colorf = packedColor/255.f;// ? 0.f : 1.f;
				btVector4 rgba(colorf,colorf,colorf,1.f);
				if (colorf)
				{
					if ((rasterposx+x>=0) && (rasterposx+x < m_internalData->m_width) &&
					(rasterposy+y>=0) && (rasterposy+y<m_internalData->m_height))
					{
					m_internalData->m_canvas->setPixel(m_internalData->m_canvasIndex,rasterposx+x,rasterposy+y,
													   red,green,blue,alpha);
					}				}
				y++;
			}
			x++;
		}
		xx+=10;
	}
}

void TimeSeriesExample::stepSimulation(float deltaTime)
{


	
	static int bar = amp;
	int resetVal = 10;
	int countdown = resetVal;
	bar--;
	
	//shift pixture one pixel to the left
	for (int j=0;j<m_internalData->m_height;j++)
	{
		for (int i=32;i<this->m_internalData->m_width;i++)
		{
			unsigned char red, green, blue, alpha;
			m_internalData->m_canvas->getPixel(m_internalData->m_canvasIndex,i,j,red,green,blue,alpha);
			m_internalData->m_canvas->setPixel(m_internalData->m_canvasIndex,i-1,j,red,green,blue,alpha);
		}
		if (!bar)
		{
			
			
			if (!countdown--)
			{
				countdown=resetVal;
				m_internalData->m_canvas->setPixel(m_internalData->m_canvasIndex,m_internalData->m_width-1,j,0,0,0,255);
			} else
			{
				m_internalData->m_canvas->setPixel(m_internalData->m_canvasIndex,m_internalData->m_width-1,j,255,255,255,255);
				
			}
		} else
		{
			m_internalData->m_canvas->setPixel(m_internalData->m_canvasIndex,m_internalData->m_width-1,j,255,255,255,255);
			
		}
	}
	if (!bar)
	{
		static int testcounter=0;
		testcounter++;
		char buf[1024];
		sprintf(buf,"%d",testcounter);
		grapicalPrintf(buf, sFontData, m_internalData->m_width-32,zero+3,0,0,0,255);
		bar=amp;
	}
	
	m_internalData->m_canvas->refreshImageData(m_internalData->m_canvasIndex);
	
	//insert some new value(s) in the right-most column
	{
		static float timer = 0.f;
		static int prevValue=0;
		timer+= 0.1;
		
		
		
		float one = zero+amp;
		float minone = zero-amp;
		float v = 128+100*sinf(timer);
		for (int value=prevValue;value<=v;value++)
		{
			if (value>=0 && value < float(m_internalData->m_height-1))
			{
				m_internalData->m_canvas->setPixel(m_internalData->m_canvasIndex,m_internalData->m_width-1,value,255,0,0,255);
			}
		}
		{
			int resetVal = 2;
			static int countdown = resetVal;
			;
			if (!countdown--)
			{
				countdown=resetVal;
				m_internalData->m_canvas->setPixel(m_internalData->m_canvasIndex,m_internalData->m_width-1,zero,0,0,0,255);
			}
		}
		
		{
			
			static int countdown = resetVal;
			;
			if (!countdown--)
			{
				countdown=resetVal;
				m_internalData->m_canvas->setPixel(m_internalData->m_canvasIndex,m_internalData->m_width-1,one,0,0,0,255);
				m_internalData->m_canvas->setPixel(m_internalData->m_canvasIndex,m_internalData->m_width-1,minone,0,0,0,255);
				
			}
		}
		
		
		for (int value=v;value<=prevValue;value++)
		{
			if (value>=0 && value < float(m_internalData->m_height-1))
			{
				m_internalData->m_canvas->setPixel(m_internalData->m_canvasIndex,m_internalData->m_width-1,value,255,0,0,255);
			}
		}
		prevValue = v;
	}
	
	{
		static float timer = 0.f;
		static int prevValue=0;
		timer+= 0.01;
		float v = 228+200*sinf(timer);
		for (int value=prevValue;value<=v;value++)
		{
			if (value>=0 && value < float(m_internalData->m_height-1))
			{
				m_internalData->m_canvas->setPixel(m_internalData->m_canvasIndex,m_internalData->m_width-1,value,0,0,255,255);
			}
		}
		for (int value=v;value<=prevValue;value++)
		{
			if (value>=0 && value < float(m_internalData->m_height-1))
			{
				m_internalData->m_canvas->setPixel(m_internalData->m_canvasIndex,m_internalData->m_width-1,value,0,0,255,255);
			}
		}
		prevValue = v;
	}
	

		m_internalData->m_canvas->refreshImageData(m_internalData->m_canvasIndex);
}


